import React from"react";

class Articles extends React.Component{
    render(){
        return(
            <div className="main">
                <div className="wrapper">
                    <div className="title">
                        <h5 style={{color:"black",fontStyle:"bold"}}>Top News</h5>
                    </div>
                </div>
            </div>
        );

    }
}
export default Articles;
